import './Header.min.css';
import { FaDumbbell } from 'react-icons/fa';
import { AiOutlineHome } from 'react-icons/ai';
import { useState } from 'react';
import { Link } from 'react-router-dom';


export const Header = () => {
  const [status, setStatus] = useState('Sign Up');
  return (
    <header id = "wrapper">
      <h1 id = "headerH1"><span>Fit</span>ify <FaDumbbell /></h1>
            <nav>
              <ul id = "nav_links">
                <li id = "home">
                  <Link to = "/" className = 'link'><AiOutlineHome id = 'house' />Home</Link>
                </li>
                <li className = "rest">
                  <Link to = "/register" className = 'link'>{status}</Link>
                </li>
                <li className = "rest">Stats</li>
                <li className = "rest">Leaderboards</li>
                <li className = "rest">Goals</li>
              </ul>
            </nav>
    </header>
  );
}
